import React from "react";
import HotelRoomCard from "./HotelRoomCard";
import { Grid } from "@mantine/core";

const HotelRoomList = () => {
  return (
    <Grid
      justify="space-between"
      gutter={"lg"}
      style={{
        border: "2px solid red",
        backgroundColor: "yellow",
        marginTop: "200px",
      }}
    >
      <HotelRoomCard />
      <HotelRoomCard />
      <HotelRoomCard />
      <HotelRoomCard />
      <HotelRoomCard />
    </Grid>
  );
};

export default HotelRoomList;
